// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Player.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
/**
    Dealer合约
    部署后：
        设置Player合约地址
        设置factory合约地址
        设置白名单（默克尔根）

    白名单mint nft：
        每个地址mint一次----userToMint控制（0可以mint, 1不能mint）

    设置白名单：后面可以加人
        nft规则允许时才能设置----dealerToDeadline控制（dealerToDeadline[id] <= block.timestamp时不能再次创建）
        在player合约中创建新的id,并设置该id对应的最大玩家数
        直接mint出player nft给参与者
 */
contract Dealer is Ownable, ERC721{

    using Strings for uint256;

    uint256 public constant TOTAL_MAX_QTY = 100;

    address public player;
    address public factory;
    bytes32 public _merkleRoot;
    uint256 public total_supply;
    string private _tokenURI;

    //用户是否mint，为0时可mint
    mapping(address => uint256) public dealerToId;
    mapping(uint256 => string) public tokenURIs;
    //查询dealer状态，为0时可用
    mapping(uint256 => uint256) public dealerType;
    //查询dealer当前对应的池子
    mapping(uint256 => address) public dealerToPool;
    //查询dealer当前对应的池子的结束时间
    mapping(uint256 => uint256) public dealerToDeadline;
    //用户是否mint，为0时可mint
    mapping(address => uint256) public userToMint;

    constructor(
        string memory name,
        string memory symbol,
        string memory tokenURI_
    ) ERC721(name, symbol) {
        _tokenURI = tokenURI_;
    }

    //mint开房权限
    function mint(uint256 index, bytes32[] calldata merkleProof) external {
        // bytes32 node = keccak256(abi.encodePacked(index, msg.sender));
        // require(MerkleProof.verify(merkleProof, _merkleRoot, node), 'MerkleDistributor: Invalid proof.');
        require(userToMint[msg.sender] == 0, 'Repeat');
        total_supply = total_supply + 1;
        _safeMint(msg.sender, total_supply);
        dealerToId[msg.sender] = total_supply;
        userToMint[msg.sender] = 1;
    }

    //初始设置玩家
    function setPlayers(uint256 id, uint256 supply, address[] memory users) external {
        require(ownerOf(id) == msg.sender, "nft owner not you");
        require(dealerToDeadline[id] <= block.timestamp, "nft is using");
        Player(player).createID(id, supply);
        Player(player).mint(users, id);
    }

    //后续设置玩家
    function addPlayers(uint256 id, address[] memory users) external {
        require(ownerOf(id) == msg.sender, "nft owner not you");
        require(dealerToDeadline[id] <= block.timestamp, "nft is using");
        Player(player).mint(users, id);
    }

    function getDealerStatus(uint256 id) view external returns(bool) {
        return block.timestamp > dealerToDeadline[id] || dealerType[id] == 0;
    }

    function setDealerToPool(uint256 id, address pool_) external onlyFactory {
        dealerToPool[id] = pool_;
    }

    function setDealerToDeadline(uint256 id, uint256 deadline) external onlyPool(id) {
        dealerToDeadline[id] = deadline;
    }

    function setDealerType(uint256 id, uint256 type_) external onlyFactory {
        dealerType[id] = type_;
    }

    function setPlayer(address player_) external onlyOwner {
        player = player_;
    }

    function setFactory(address factory_) external onlyOwner {
        factory = factory_;
    }

    function setMerkleRoot(bytes32 merkleRoot_) external onlyOwner {
        _merkleRoot = merkleRoot_;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        string memory baseURI = _baseURI();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, tokenId)) : "";
    }

    function setTokenURI(string memory tokenURI_) external {
        _tokenURI = tokenURI_;
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _tokenURI;
    }

    modifier onlyFactory {
        require(msg.sender == factory, "not factory");
        _;
    }

    modifier onlyPool(uint256 id) {
        require(msg.sender == dealerToPool[id], "not factory");
        _;
    }
}
